import img from "../images/3-bg.png"
export default function main() {
  return (
    <div className=''>
       
        <div className='flex items-start'>
       <img className='h-96 ml-20' src={img} alt="Not found"/>
       <h1 className='font-bold text-4xl text-yellow-500'>About me</h1>
       </div>
    </div>
  )
}
